import React, { Component } from 'react';
import { Box, TextField } from '@material-ui/core';

const styles = {
  container: {
    width: '100%',
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
  },
  username: {
    margin: 100,
  },
  password: {
    margin: 100,
  },
};
export default class LoginBox extends Component {
  render() {
    return (
      <Box style={styles.container}>
        <TextField style={styles.username} placeholder="Email" />
        <TextField style={styles.password} placeholder="password" />
      </Box>
    );
  }
}
